      <text id="128" justification="0" size="4" underlined="false">
        <text>The Class Instrumenter
is almost identical to the 
original from the Jacoco,
the only difference is
the probes are stored
as a Map&amp;lt;Integer,Boolean&amp;gt;
instead of a boolean[].
Also the probes map is a custom 
implementation of the Map
interface, with some fancy
ThreadLocal logic, to keep
coverage isolated for each Trial.</text>
      </text>
      <color reference="118"/>
    </NoteNode>
    <NoteNode id="129">

      <textColor class="javax.swing.plaf.ColorUIResource" reference="44"/>
      <text id="133" justification="0" size="4" underlined="false">
        <text>This diagram illustrates multi-threaded
loading, dependency discovery and 
instrumentation of classes.  Everything
to the right of the CoveragePlugin is done inside a 
I_TrialInstrumenter stored in a ThreadLocal.
&lt;br/&gt;
Also note the dependencies are used for circular 
dependency detection and dependency group
assertions for SourceFileTrials using;
@SourceFileScope
@AllowedDependencies
</text>
      </text>
      <color reference="118"/>
